import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom'; // Import Router, Routes, and Route as needed
import Home from './components/Home';
import About from './components/About';
import Contact from './components/Contact';

function App() {
    return (
        <Router> {/* Use Router here if you aliased BrowserRouter */}
            <div>
                <nav>
                    <ul>
                        <li><Link to="/">Home</Link></li> {/* Ensure Link is imported */}
                        {/* Other navigation links */}
                    </ul>
                </nav>
                <Routes>
                    <Route path="/" element={<Home />} />
                    <Route path="/about" element={<About />} />
                    <Route path="/contact" element={<Contact />} />
                    {/* Other routes */}
                </Routes>
            </div>
        </Router>
    );
}

export default App;
